import './App.css';
import {Routes, Route} from 'react-router-dom';
import RusTrainer from './RusTrainer';
import EngTrainer from './EngTrainer';
import NavBar from './NavBar';

function App() {
  return (
    <>
    <NavBar />
    <Routes>
      <Route path='/rus' element={<RusTrainer />} />
      <Route path='/eng' element={<EngTrainer />} />
    </Routes>
    </>
  );
}

export default App;
